  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains hydrologic cataloging-unit
  boundaries for selected units within the Powder River drainage basin of Wyoming.
  The hydrologic unit boundaries were delineated by using a hydrologically-conditioned
  digital elevation model covering the Powder River drainage basin to produce preliminary
  boundaries of smaller hydrologic units. Interactive editing followed in which the
  cataloging-unit boundaries were digitized on computer monitor screens displaying
  at least three important reference data layers: 1:24,000-scale U.S. Geological Survey
  digital raster graphics (images of topographic quadrangle maps); 1:24,000-scale
  DEM-derived preliminary boundaries; and 1:250,000-scale cataloging-unit boundaries.\",\n\t\"owner_org\":
